INSERT INTO `mw_localinfo` VALUES ('1', 'Club Lounge', 'club_lounge.png', '&lt;p&gt;Unwind at our Club Lounge, which offers complimentary breakfast &amp;amp; daily refreshments along with breath-taking Marina and ocean views.&lt;/p&gt;\n', '2016-09-25 11:56:40', '2020-12-14 13:49:19', 'en'), ('2', 'DreamWorks Spa', 'dreamworks_spa.png', '&lt;p&gt;Experience a new level of bliss with a hot stone or Thai massage. Nourish yourself with luxe skin treatments and reflexology. Breathe deep and relax.&lt;/p&gt;\n', '2016-09-25 11:58:22', '2020-12-14 13:49:01', 'en'), ('3', 'Swimming Pool & Bar', 'swimming_pool.png', '&lt;p&gt;Sip a refreshing beverage in a comfy lounge chair or take a dip in the pool to cool off while enjoying views of Dubai Marina&amp;rsquo;s skyline.&lt;/p&gt;\n', '2016-09-25 11:55:35', '2020-12-14 13:49:32', 'en'), ('4', 'Fitness Centre', 'fitness_center.png', '&lt;p&gt;Keeping your exercise routine is easy in our bright and inviting gym. Get energized with premium cardio machines, free weights, and strength-training gear.&lt;/p&gt;\n', '2016-09-25 11:56:07', '2020-12-14 13:49:47', 'en'), ('5', 'Flexible Conference Room', 'flexible_conference_room.png', '&lt;p&gt;Enjoy plenty of natural light and great views of Dubai Marina from the large windows in this comfortable space. Ergonomic chairs inspire productivity for your board meeting or brainstorming session.&lt;/p&gt;\n', '2020-12-14 13:50:44', '2020-12-14 13:49:47', 'en');
COMMIT;

